import React from 'react';
import './Footer.css'
import { Route, Link } from 'react-router-dom'


function Footer() {
    return(
        <footer className="footer">
            <h3 className="footer__title">©Pankov Pavel</h3>
            <Route className="footer__route" path="/">Главная</Route>
            <Link className="footer__link" to="https://praktikum.yandex.ru/profile/web/">Яндекс.Практикум</Link>
        </footer>
    )
}

export default Footer;
